export default function TaskList({ title, tasks , onEditTask}) {
    // const categories = ['To DO', 'In Progress', 'Done'];
  const handleEdit = (e) =>{
    console.log("Editing Task:", e.target.innerText);
    onEditTask(e.target.innerText);
  }
    return (
    <div>
        <h2>{title}</h2>
     {tasks.map((task, index) => (
       <div key={index}>
         <h3 >{task.id}</h3> <button contentEditable="true" onClick={(e) => handleEdit(e.target.value)}>Edit</button>   

       </div>
     ))}    
    </div>
  );
}
